        var multiples = Math.floor(betting/unit);
        var biggestChipIndex = ChipRatio.findIndex(function(item){
            return multiples >= item;
        });
        if(biggestChipIndex < 0) biggestChipIndex = ChipRatio.length;
        var chipArray = [];
